import React, { useState } from "react";
import API from "../api";
import { saveToken } from "../auth";
import { useNavigate } from "react-router-dom";

const Register = () => {
  const [form, setForm] = useState({
    firstName: "",
    lastName: "",
    email: "",
    password: "",
  });
  const navigate = useNavigate();

  const handleChange = (e) =>
    setForm({ ...form, [e.target.name]: e.target.value });

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      const { data } = await API.post("/auth/register", form);
      saveToken(data.token);
      navigate("/dashboard");
    } catch (err) {
      alert(err.response?.data?.message || "Registration failed");
    }
  };

  return (
    <div className="d-flex justify-content-center align-items-center vh-100">
      <div
        className="card shadow-lg border-0 animate__animated animate__fadeInUp"
        style={{ width: "420px", background: "linear-gradient(135deg, #f8f9fa, #e0eafc)" }}
      >
        <div className="card-body p-4">
          <h2
            className="text-center fw-bold mb-4"
            style={{
              background: "linear-gradient(90deg, #43cea2, #185a9d)",
              WebkitBackgroundClip: "text",
              color: "transparent",
            }}
          >
            📝 Create Account
          </h2>

          <form onSubmit={handleSubmit}>
            <div className="mb-3">
              <label className="form-label fw-semibold">First Name</label>
              <div className="input-group">
                <span className="input-group-text bg-success text-white">👤</span>
                <input
                  className="form-control shadow-sm"
                  name="firstName"
                  placeholder="Enter first name"
                  onChange={handleChange}
                  required
                />
              </div>
            </div>

            <div className="mb-3">
              <label className="form-label fw-semibold">Last Name</label>
              <div className="input-group">
                <span className="input-group-text bg-success text-white">👤</span>
                <input
                  className="form-control shadow-sm"
                  name="lastName"
                  placeholder="Enter last name"
                  onChange={handleChange}
                  required
                />
              </div>
            </div>

            <div className="mb-3">
              <label className="form-label fw-semibold">Email</label>
              <div className="input-group">
                <span className="input-group-text bg-success text-white">📧</span>
                <input
                  className="form-control shadow-sm"
                  type="email"
                  name="email"
                  placeholder="Enter email"
                  onChange={handleChange}
                  required
                />
              </div>
            </div>

            <div className="mb-3">
              <label className="form-label fw-semibold">Password</label>
              <div className="input-group">
                <span className="input-group-text bg-success text-white">🔑</span>
                <input
                  className="form-control shadow-sm"
                  type="password"
                  name="password"
                  placeholder="Enter password"
                  onChange={handleChange}
                  required
                />
              </div>
            </div>

            <button
              className="btn w-100 mt-2 shadow-sm"
              style={{
                background: "linear-gradient(90deg, #43cea2, #185a9d)",
                border: "none",
                color: "white",
                fontWeight: "600",
              }}
            >
              Register ✨
            </button>
          </form>

          <p className="text-center mt-3">
            Already have an account?{" "}
            <span
              onClick={() => navigate("/login")}
              style={{
                cursor: "pointer",
                color: "#185a9d",
                fontWeight: "bold",
              }}
            >
              Login here
            </span>
          </p>
        </div>
      </div>
    </div>
  );
};

export default Register;
